`,W.jsx(t.h2,{children:"Scope"}),`
`,W.jsxs(t.p,{children:["According to the ",W.jsx(t.a,{href:"https://github.com/polkadot-fellows/manifesto/blob/0c3df46d76625980b8b48742cb86f4d8fa6dda8d/manifesto.pdf",children:"Fellowship Manifesto"}),", members of the Polkadot Fellowship are responsible for expertise in the strict description(s) and/or implementation(s) of these areas of contribution:"]}),`
`,W.jsxs(t.ul,{children:[`
`,W.jsx(t.li,{children:"the internals of all functional Polkadot node implementations;"}),`
`,W.jsx(t.li,{children:"cryptographic data-structures, algorithms, languages and APIs required for the continued upkeep of the Polkadot (Main) Network;"}),`
`,W.jsx(t.li,{children:"consensus algorithms concerning the Relay-chain (BABE & GRANDPA);"}),`
